import React from "react";
import { Link } from "react-router-dom";

import "./navbar";

const Navbar = () => (
  <div className='header'>
      <Link to='/' className='logo-container'>

      </Link>
    <div className='links'>
        <Link to='/shop'>SHOP</Link>
        <Link to='/contact'>CONTACT</Link>
    </div>
  </div>
);

export default Navbar;
